import Particles from 'react-particles-js';

class Visual extends Component {
	render () {
		return (
			<Particles  params={{
	    "particles": {
	        "number": {
	            "value": 50
	        },
	        "size": {
	            "value": 3
	        }
	    },
	    "interactivity": {
	        "events": {
	            "onhover": {
	                "enable": true,
	                "mode": "repulse"
	            }
	        }
	    }
	}}/>
		)
	}
}

export default Visual;
